function lengthOfLongestSubstring(s: string): number {
  let substring = '';
  let defSubstring = '';
  let manip = 0;
  for (let i = 0; i < s.length; i) {
    if (s[i+1] && s[i] !== s[i+1] && !substring.includes(s[i])) {
      substring += s[i];
      i++;
    } else if (s[i+1] && s[i] !== s[i+1] && substring.includes(s[i])) {
      defSubstring = substring.length > defSubstring.length ? substring : defSubstring;
      substring = '';
      manip++;
      i = manip;
    } else if (s[i+1] && s[i] === s[i+1] && !substring.includes(s[i])) {
      substring += s[i];
      defSubstring = substring.length > defSubstring.length ? substring : defSubstring;
      substring = '';
      manip++;
      i = manip;
    } else if (s[i+1] && s[i] === s[i+1] && substring.includes(s[i])) {
      defSubstring = substring.length > defSubstring.length ? substring : defSubstring;
      substring = '';
      manip++;
      i = manip;
    } else if (!s[i+1] && s[0] && !substring.includes(s[i])) {
      substring += s[i];
      defSubstring = substring.length > defSubstring.length ? substring : defSubstring;
      i++;
    } else if (!s[i+1] && s[0] && substring.includes(s[i])) {
      defSubstring = substring.length > defSubstring.length ? substring : defSubstring;
      i++;
    }
  }
  return defSubstring.length
};

